import React from 'react'

const ArtWork = ({artWorks}) => {
  console.log("art: ", artWorks)
  return(
    <div>
      { artWorks && artWorks.map(art => {
          return (
            <div className="art card z-depth-0">
              <Link to={`../../projectdetails/${art.id}`}>
                <div>
                  <div className="author_name">
                    <span className="">
                      {`${art.authorFirstName} ${art.authorSecondName}`}
                    </span>
                  </div>
                  <img
                    src={art.imageUrl}
                    alt="x"
                    className="responsive-img"/>
                  <span className="art_content">
                    {art.content}
                  </span>
                </div>
              </Link>
            </div>
          )
      })}
    </div>
  )
}

export default ArtWork
